import {useLocation} from "react-router-dom";
import Header from "../../Header";
import {useEffect, useState} from "react";
import axios from "axios";

export function UserRentalList() {

  const location = useLocation();

  const userId = location.state.userId;

  const [status, setStatus] = useState(null);

  const [userRentals, setUserRentals] = useState([
    {
      userId: '',
      email: '',
      name: '',
      books: [],
    }
  ]);

  useEffect(() => {
    axios.get("http://localhost:8080/api/v1/users/" + userId + "/rentals")
    .then(function (success) {
      console.log(success);

      setStatus(success.status);

      console.log("status! : " + status);

      console.log(success.data);
      setUserRentals(success.data);
    }).catch(function (error) {
      setStatus(error.response.status);

    })

    ;
  }, []);

  return (
      <div>
        <div>
          <Header headername="유저 대여 목록"/>
        </div>

        <div className="user_info">
          <div className="info_box">
            <div className="p_box"><div className="strong_box">유저 Id : </div><div className="user_properties">33</div></div>
            <div className="p_box"><div className="strong_box">유저 이메일 : </div><div className="user_properties">useremail@naver.com</div></div>
            <div className="p_box"><div className="strong_box">유저 이름 : </div><div className="user_properties">김한반두프로퍼티스</div></div>
            <div className="p_box"><div className="strong_box">대여 권 수 : </div><div className="user_properties">500 권</div></div>
          </div>
        </div>

        <div>
          <table className="table_user_rentals_container">
            <thead className="thead">
            <tr className="list_wrap">
              <th className="list_name">책 Id</th>
              <th className="list_name">책 이름</th>
              <th className="list_name">책 유형</th>
              <th className="list_name">책 대여 상태</th>
              <th className="list_name">책 등록일</th>
              <th className="list_name">반납</th>

            </tr>
            </thead>


            <tbody>
            {

              status === 200 ?

                  // eslint-disable-next-line array-callback-return
                  userRentals.books && userRentals.books.map(book => {
                    return (<tr className="tr" key={book.id}>
                          <td className="">{book.id}</td>
                          <td className="">{book.bookName}</td>
                          <td className="">{book.bookType}</td>
                          <td className="">{book.bookStatus}</td>
                          <td className="">{book.createdAt}</td>
                          <td>
                            <button className="booking_no_btn">반납 하기
                            </button>


                          </td>

                        </tr>
                    )
                  })
                  : <div></div>
            }


            </tbody>
          </table>

          {
            status === 404 ? <div className="no_data"><h1> 데이터가 없습니다 </h1></div>
                : <div></div>
          }
        </div>

      </div>
  )
}
